css:
.markdown-preview .editor-colors {
  color: #222;
  background: #f8f8f8;
}
.markdown-preview .editor-colors .invisible {
  color: #555;
}
.markdown-preview .editor-colors .comment {
  color: #999988;
  font-style: italic;
}
.markdown-preview .editor-colors .string {
  color: #D14;
}
.markdown-preview .editor-colors .source .string .source,
.markdown-preview .editor-colors .source .string .meta.embedded.line {
  color: #5A5A5A;
}
.markdown-preview .editor-colors .source .string .punctuation.section.embedded {
  color: #920B2D;
}
.markdown-preview .editor-colors .source .string .punctuation.section.embedded .source {
  color: #920B2D;
}
.markdown-preview .editor-colors .constant.numeric {
  color: #D14;
}
.markdown-preview .editor-colors .constant.language {
  color: #606aa1;
}
.markdown-preview .editor-colors .constant.character,
.markdown-preview .editor-colors .constant.other {
  color: #606aa1;
}
.markdown-preview .editor-colors .constant.symbol {
  color: #990073;
}
.markdown-preview .editor-colors .constant.numeric.line-number.find-in-files .match {
  color: rgba(143, 190, 0, 0.63);
}
.markdown-preview .editor-colors .variable {
  color: #008080;
}
.markdown-preview .editor-colors .variable.parameter {
  color: #606aa1;
}
.markdown-preview .editor-colors .keyword {
  color: #222;
  font-weight: bold;
}
.markdown-preview .editor-colors .keyword.unit {
  color: #445588;
}
.markdown-preview .editor-colors .keyword.special-method {
  color: #0086B3;
}
.markdown-preview .editor-colors .storage {
  color: #222;
}
.markdown-preview .editor-colors .storage.type {
  color: #222;
}
.markdown-preview .editor-colors .entity.name.class {
  text-decoration: underline;
  color: #606aa1;
}
.markdown-preview .editor-colors .entity.other.inherited-class {
  text-decoration: underline;
  color: #606aa1;
}
.markdown-preview .editor-colors .entity.name.function {
  color: #900;
}
.markdown-preview .editor-colors .entity.name.tag {
  color: #008080;
}
.markdown-preview .editor-colors .entity.other.attribute-name {
  color: #458;
  font-weight: bold;
}
.markdown-preview .editor-colors .entity.name.filename.find-in-files {
  color: #E6DB74;
}
.markdown-preview .editor-colors .support.constant,
.markdown-preview .editor-colors .support.function,
.markdown-preview .editor-colors .support.type {
  color: #458;
}
.markdown-preview .editor-colors .support.class {
  color: #008080;
}
.markdown-preview .editor-colors .invalid {
  color: #F8F8F0;
  background-color: #00A8C6;
}
.markdown-preview .editor-colors .invalid.deprecated {
  color: #F8F8F0;
  background-color: #8FBE00;
}
.markdown-preview .editor-colors .meta.structure.dictionary.json > .string.quoted.double.json,
.markdown-preview .editor-colors .meta.structure.dictionary.json > .string.quoted.double.json .punctuation.string {
  color: #000080;
}
.markdown-preview .editor-colors .meta.structure.dictionary.value.json > .string.quoted.double.json {
  color: #d14;
}
.markdown-preview .editor-colors .meta.diff,
.markdown-preview .editor-colors .meta.diff.header {
  color: #75715E;
}
.markdown-preview .editor-colors .meta.function span {
  color: #990000;
  font-weight: bold;
}
.markdown-preview .editor-colors .meta.selector.css .css {
  color: #333;
}
.markdown-preview .editor-colors .meta.selector.css .entity.name.tag,
.markdown-preview .editor-colors .meta.selector.css .entity.other.class {
  color: #445588;
  font-weight: bold;
  text-decoration: none;
}
.markdown-preview .editor-colors .meta.property-name .css.support.property-name {
  font-weight: bold;
  color: #333;
}
.markdown-preview .editor-colors .meta.property-value .css.constant {
  color: #099;
}
.markdown-preview .editor-colors .meta.property-value .css.support.constant.property-value {
  color: #333;
  font-weight: bold;
}
.markdown-preview .editor-colors .source.gfm {
  color: #444;
}
.markdown-preview .editor-colors .gfm .markup.heading {
  color: #111;
}
.markdown-preview .editor-colors .gfm .link {
  color: #888;
}
.markdown-preview .editor-colors .gfm .variable.list {
  color: #888;
}
.markdown-preview .editor-colors .markdown .paragraph {
  color: #444;
}
.markdown-preview .editor-colors .markdown .heading {
  color: #111;
}
.markdown-preview .editor-colors .markdown .link {
  color: #888;
}
.markdown-preview .editor-colors .markdown .link .string {
  color: #888;
}
